import express from 'express';
import cors from 'cors';
import bodyParser from 'body-parser';

const app = express();

app.use(cors());
app.use(
  bodyParser.json({
    type(req) {
      return true;
    },
  }),
);
app.use(function (req, res, next) {
  res.setHeader('Content-Type', 'application/json');
  next();
});

